INSERT INTO `t_xj_admin_log` VALUES ('1525504829982539778', NULL, NULL, '2022-05-14 23:54:30', '2022-05-14 23:54:30', 0, 0, '平台主账号', '1', 0, 'http://192.168.0.2:9000/views/test/gcTest/gcTest', 'http://127.0.0.1:9049/api/admin/test/gcTest/1485868996178743298', '/api/admin/test/gcTest/1485868996178743298', '192.168.0.2', '127.0.0.1', 'PUT', '127.0.0.1', '51910', 'io.github.wslxm.springbootplus2.manage.test.controller', 'io.github.wslxm.springbootplus2.manage.test.controller.GcTestController', '代码生成测试表', 'ID编辑', '[\"1485868996178743298\",{\"age\":0.0,\"city\":1,\"disable\":1,\"headUrl\":\"http://xijia-sz.oss-cn-shenzhen.aliyuncs.com/oss/file/file/gc/24735070-234308-16202293885efd.jpg\",\"like\":\"1\",\"name\":\"111\",\"sex\":1,\"text\":\"111\",\"textTwo\":\"<div class=\\\"c-font-normal c-color-text ellipsis_efK7X\\\" aria-label=\\\"职业：演员、导演\\\">\\n<div class=\\\"text_2NOr6\\\">职业：演员、导演</div>\\n</div>\\n<div class=\\\"c-font-normal c-color-text ellipsis_efK7X\\\" aria-label=\\\"生日：1984年6月26日\\\">\\n<div class=\\\"text_2NOr6\\\">生日：1984年6月26日</div>\\n</div>\\n<div class=\\\"c-font-normal c-color-text ellipsis_efK7X\\\" aria-label=\\\"个人信息：172 cm/巨蟹座/O型\\\">\\n<div class=\\\"text_2NOr6\\\">个人信息：172 cm/巨蟹座/O型</div>\\n</div>\\n<div class=\\\"c-font-normal c-color-text ellipsis_efK7X\\\" aria-label=\\\"代表作品：雪豹、西游&middot;降魔篇、裸婚时代、失恋33天、海洋天堂、小爸爸、奋斗、少帅、陆垚知马俐、剃刀边缘\\\">\\n<div class=\\\"text_2NOr6\\\">代表作品：雪豹、西游&middot;降魔篇、裸婚时代、失恋33天、海洋天堂、小爸爸、奋斗、少帅、陆垚知马俐、剃刀边缘</div>\\n</div>\\n<div>\\n<div class=\\\"c-font-normal c-color-text\\\" aria-label=\\\"文章，1984年6月26日出生于陕西省西安市雁塔区，中国内地男演员、导演，毕业于中央戏剧学院表演系。2006年，参演电视剧《与青春有关的日子》，开始在影视圈崭露头角。2005年，拍摄古装剧《锦衣卫》。2007年，主演赵宝刚导演的青春剧《奋斗》；同年，主演首部电影《走着瞧》。2008年，主演滕华涛执导的电视剧《蜗居》，饰演80后城市青年小贝。2009年，在电影《海洋天堂》中扮演自闭症患者王大福；同年，参演抗战剧《雪豹》。2011年，主演的电视剧《裸婚时代》播出；同年，连续2年获得北京大学生电影节最受大学生欢迎男演员奖。2012年，凭借电影《失恋33天》获得第31届大众电影百花奖最佳男主角奖；同年，成立北京君竹影视文化有限公司，并导演第一部影视作品《小爸爸》。2013年2月，主演的电影《西游&middot;降魔篇》在全国上映。2014年3月28日，主演的爱情片《我在路上最爱你》上映。2014年，在姜文执导的\\\">\\n<div class=\\\"text_2NOr6\\\"